(7,'ពត៌មានសកម្មភាពការងារការិយាល័យគ្រប់គ្រងការអភិវឌ្ឍវិជ្ជាជីវៈ​ជាប្រចាំ','ពត៌មានសកម្មភាពការងារការិយាល័យគ្រប់គ្រងការអភិវឌ្ឍវិជ្ជាជីវៈ​ជាប្រចាំ','home_content_pr',1,'','','1',1,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(8,'High quality, needs-based continuous professional development (CPD) for education staff leads to motivated teachers, improved teaching and learning, better student achievement, career progression and recognition as professionals.','ការអភិវឌ្ឍវិជ្ជាជីវៈបុគ្គលិកអប់រំដែលមានគុណភាព និងឆ្លើយតបទៅនឹងតម្រូវការជាក់ស្តែងរបស់សាលារៀន នឹងនាំឱ្យមានផលជះជាវិជ្ជមានដល់ការដឹកនាំ ការបង្រៀន និងលទ្ធផលសិក្សារបស់សិស្ស ព្រមទាំងទទួលបានការដំឡើងឋានៈវិជ្ជាជីវៈ ការអបអរសាទរពីសាលារៀន និងសហគមន៍។','head_text',1,'','','1',1,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(9,'ពត៌មានសកម្មភាពការងារការិយាល័យគ្រប់គ្រងការអភិវឌ្ឍវិជ្ជាជីវៈ​ជាប្រចាំ','ពត៌មានសកម្មភាពការងារការិយាល័យគ្រប់គ្រងការអភិវឌ្ឍវិជ្ជាជីវៈ​ជាប្រចាំ','res_title_1',1,'','','1',1,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(10,'The Continuous Professional Development Management Office (CPDMO) manages a high quality, school-based professional development system,\r\n             which supports and empowers educators to ensure that every public school in Cambodia has well-qualified and effective teachers and school directors\r\n             who are lifelong learners, continuously reflecting on and improving their own performance and that of their students.','ការិយាល័យគ្រប់គ្រងការអភិវឌ្ឍវិជ្ជាជីវៈជាប្រចាំ (CPDMO) គ្រប់គ្រងប្រព័ន្ធអភិវឌ្ឍន៍វិជ្ជាជីវៈដែលមានគុណភាពខ្ពស់និងផ្អែកលើសាលា។\r\n             ដែលគាំទ្រនិងផ្តល់អំណាចដល់អ្នកអប់រំដើម្បីធានាថាគ្រប់សាលារដ្ឋនៅកម្ពុជាមានគ្រូ និងនាយកសាលា ដែលមានសមត្ថភាពនិងប្រសិទ្ធភាពខ្ពស់ \r\n             ដែលជាអ្នកសិក្សាពេញមួយជីវិត ដោយឆ្លុះបញ្ចាំងពីការអភិវឌ្ឍសកម្មភាពបង្រៀនរបស់ខ្លួនជាប្រចាំទៅកាន់សិស្ស។','footer_content1',0,'','','1',0,'0',1,1,1,'2021-11-23 00:55:24','2023-06-07 09:58:41'),
