(18,'The CPDMO organizes and regulates CPD within MoEYS, using interdepartmental teams to perform the following roles and functions:','ការិយាល័យគ្រប់គ្រង អវប រៀបចំនិងធ្វើនិយ័តកម្ម អវប នៅក្នុងក្រសួងអប់រំយុវជននិងកីឡាដោយប្រើប្រាស់ក្រុមអន្តរក្រសួងដើម្បីអនុវត្តតួនាទីនិងមុខងារដូចខាងក្រោម៖','about_title_2',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(19,'Manage and regulate CPD delivery, including benchmarking, accreditation and quality assurance','គ្រប់គ្រងនិងគ្រប់គ្រងការផ្តល់ជូន អវប រួមមានការបញ្ជាក់ស្តង់ដារការទទួលស្គាល់និងការធានាគុណភាព','about_li_1',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(20,'Manage CPD data and credits','គ្រប់គ្រងទិន្នន័យនិង credits','about_li_2',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(21,'Manage information dissemination and communication with teachers, school leaders and education specialists','គ្រប់គ្រងការផ្សព្វផ្សាយព័ត៌មាននិងទំនាក់ទំនងជាមួយគ្រូ នាយកសាលានិងអ្នកជំនាញអប់រំ','about_li_3',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(22,'Develop and manage an HRMIS system to manage teacher HR data, including data on CPD for education personnel, as set out in the Continuous Professional Development Framework for Teachers and School Directors','អភិវឌ្ឍនិងគ្រប់គ្រងប្រព័ន្ធ HRMIS ដើម្បីគ្រប់គ្រងទិន្នន័យធនធានមនុស្សរបស់គ្រូរួមទាំងទិន្នន័យអំពី​ អវប សម្រាប់បុគ្គលិកអប់រំដូចមានចែងក្នុងក្របខ័ណ្ឌអភិវឌ្ឍន៍វិជ្ជាជីវៈជាបន្តសម្រាប់គ្រូនិងនាយកសាលា។','about_li_4',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(23,'Manage the CPD module of the HRMIS, including information on CPD providers and CPD offerings, in addition to records of CPD undertaken by education personnel, and generate reports and statistics as needed','គ្រប់គ្រងម៉ូឌុល អវប នៃ ប្រព័ន្ធគ្រប់គ្រងធនធានមនុស្ស រួមទាំងព័ត៌មានអំពីអ្នកផ្តល់ អវប និងការផ្តល់ជូន អវប បន្ថែមលើកំណត់ត្រារបស់ អវប អនុវត្តដោយបុគ្គលិកអប់រំនិងបង្កើតរបាយការណ៍និងស្ថិតិតាមតម្រូវការ។','about_li_5',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
