(25,'Manage progression on the TCP for teachers, school leaders, and education specialists, and generate reports and statistics as needed','គ្រប់គ្រងវឌ្ឍនភាពនៅលើ TCP សម្រាប់គ្រូ នាយកសាលា និងអ្នកជំនាញអប់រំហើយបង្កើតរបាយការណ៍និងស្ថិតិតាមតម្រូវការ','about_li_7',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
