(27,'Provide CPD certificates for teachers, school leaders and education specialists every 5 years or as needed','ផ្តល់វិញ្ញាបនប័ត្រ អវប សម្រាប់គ្រូ នាយកសាលា និងអ្នកជំនាញអប់រំ រៀងរាល់ ៥ ឆ្នាំម្តងឬតាមតម្រូវការ','about_li_8',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(28,'Re-categorize teachers who qualify for a higher professional category','ចាត់ថ្នាក់ឡើងវិញនូវគ្រូដែលមានលក្ខណៈគ្រប់គ្រាន់សម្រាប់ប្រភេទវិជ្ជាជីវៈខ្ពស់','about_li_9',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(29,'Define accreditation criteria for CPD or INSET providers, CPD offerings, career advancement, recognition awards, etc.','កំណត់លក្ខណៈវិនិច្ឆ័យការទទួលស្គាល់សម្រាប់អ្នកផ្តល់ អវប ឬ INSET ការផ្តល់ជូន អវប ការជម្រុញអាជីព ការផ្តល់រង្វាន់ ការទទួលស្គាល់ជាដើម។','about_li_10',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(30,'Disseminate information on CPD offerings provided by Teacher Education Institutions (TEIs) or other CPD providers','ផ្សព្វផ្សាយព័ត៌មានស្តីពីការផ្តល់ជូន​ អវប ផ្តល់ជូនដោយស្ថាប័នអប់រំគ្រូ (TEIs) ឬអ្នកផ្តល់សេវាកម្ម អវប ផ្សេងទៀត','about_li_11',2,'','','1',2,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
