(39,'CPD stands for Continuous Professional Development and is the term used to describe the learning activities professionals engage in to develop and enhance their abilities.','អវប តំណាងឱ្យការបន្តអភិវឌ្ឍវិជ្ជាជីវៈនិងជាពាក្យដែលត្រូវបានប្រើដើម្បីពិពណ៌នាសកម្មភាពសិក្សាដែលអ្នកជំនាញចូលរួមក្នុងការអភិវឌ្ឍនិងបង្កើនសមត្ថភាពរបស់ពួកគេ។','exp_title_3',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
