(41,'CPD Explained','អវប ត្រូវបានពន្យល់','exp_title_4',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(42,'The CPD credit system will consider two categories of CPD:','ប្រព័ន្ធ អវប credit នឹងកំនត់ អវប ជាពីរប្រភេទ៖','exp_title_5',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(43,'CPD credits may be earned for both types of CPD. The CPD system is being introduced in Cambodia as a phased process, beginning with structured CPD.','ក្រេឌីត អវប អាចទទួលបានសម្រាប់ អវប ទាំងពីរប្រភេទ។ ប្រព័ន្ធ អវប កំពុងត្រូវបានណែនាំនៅក្នុងប្រទេសកម្ពុជាជាដំណើរការដែលចាប់ផ្តើមជាដំណាក់កាលដោយចាប់ផ្តើមពី អវប ដែលមានរចនាសម្ព័ន្ធ','exp_title_6',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(44,'One CPD credit is awarded for:','អវប ត្រូវបានផ្តល់ជូនសម្រាប់៖','exp_title_7',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(45,'CPD enables learning to become conscious and proactive, rather than passive and reactive. CPD is the holistic commitment of professionals towards the enhancement of personal skills and proficiency throughout their careers.','អវប ជួយឱ្យការរៀនសូត្រក្លាយជាមនសិការ និងសកម្មជាជាងអកម្ម និងប្រតិកម្ម។ អវប គឺជាការប្តេជ្ញាចិត្តរួមរបស់អ្នកជំនាញឆ្ពោះទៅរកការបង្កើនជំនាញផ្ទាល់ខ្លួន និងជំនាញទូទាំងអាជីពរបស់ពួកគេ។','exp_title_8',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(46,'CPD combines different methodologies to learning, such as training workshops, conferences and events, e-learning programs, best practice techniques and ideas sharing, all focused for an individual to improve and have effective professional development.','អវប រួមបញ្ចូលវិធីសាស្រ្តផ្សេងៗគ្នាក្នុងការរៀនសូត្រដូចជាសិក្ខាសាលាបណ្តុះបណ្តាលសន្និសីទនិងព្រឹត្តិការណ៍កម្មវិធីរៀនតាមអ៊ិនធឺរណែតបច្ចេកទេសអនុវត្តល្អ ៗ និងចែករំលែកគំនិតយោបល់ដែលផ្តោតលើបុគ្គលម្នាក់ៗឱ្យប្រសើរឡើងនិងមានការអភិវឌ្ឍវិជ្ជាជីវៈប្រកបដោយប្រសិទ្ធភាព។','exp_title_9',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(47,'Content and assessment to be measured against benchmarks','មាតិកានិងការវាយតម្លៃដែលត្រូវវាស់នឹងគោលការណ៍','exp_title_10',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(48,'CPD credits are awarded on the basis of the:','CPD credits ត្រូវបានផ្តល់ជូនដោយផ្អែកលើ៖','exp_title_11',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(49,'Structured CPD, which refers to formal courses or other CPD activities delivered by an accredited CPD provider: often a TEI, a development partner or a technical department of the MoEYS; and','អវប មានរចនាសម្ព័ន្ធដែលសំដៅទៅលើវគ្គសិក្សាជាផ្លូវការឬសកម្មភាព អវប ផ្សេងទៀតដែលផ្តល់ដោយអ្នកផ្តល់ អវប ដែលមានការទទួលស្គាល់ មានដូចជា ស្ថាប័នអប់រំគ្រូ (TEI), ឬនាយកដ្ឋានបច្ចេកទេសនៃក្រសួងអប់រំយុវជននិងកីឡា និង','exp_li_1',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(50,'Self-directed CPD, which refers to CPD undertaken by the educator without the formal support of an accredited provider but within the scope of the CPD framework.','អវប ដឹកនាំដោយខ្លួនឯងដែលសំដៅទៅលើ អវប ដែលអនុវត្តដោយអ្នកអប់រំដោយគ្មានការគាំទ្រជាផ្លូវការពីអ្នកផ្តល់ការទទួលស្គាល់ប៉ុន្តែស្ថិតក្នុងវិសាលភាពនៃក្របខ័ណ្ឌ អវប','exp_li_2',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(51,'15 hours face-to-face + 30 hours self-study or 45 hours laboratory or fieldwork (or a combination) OR','សិក្សា ១៥ ម៉ោងទល់មុខគ្នា + ៣០ ម៉ោងសិក្សាដោយខ្លួនឯងឬ ៤៥ ម៉ោងក្នុងមន្ទីរពិសោធន៍ឬការងារធ្វើផ្ទាល់ (ឬការរួមបញ្ចូលគ្នា) ឬ','exp_li_3',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(52,'15 hours “input” from an accredited source + 30 hours self-directed practical work, research, or application of the input or 45 hours laboratory or fieldwork (or a combination) which conforms to accepted benchmarks of quality and measurable output/outcomes','“ ការបញ្ចូល” ចំនួន ១៥ ម៉ោងពីប្រភពដែលបានទទួលស្គាល់ + ៣០ ម៉ោងលើការងារជាក់ស្តែងដឹកនាំការស្រាវជ្រាវផ្ទាល់ឬអនុវត្តធាតុចូលឬមន្ទីរពិសោធន៍ឬទីវាល ៤៥ ម៉ោង (ឬ​ ការរួមបញ្ចូលគ្នា) ដែលអនុលោមតាមស្តង់ដារដែលទទួលយកនៃគុណភាពនិងលទ្ធផល / លទ្ធផលដែលអាចវាស់វែងបាន','exp_li_4',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(53,'Assessment:','ការវាយតម្លៃ:','exp_li_5',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(54,'15% attendance and punctuality (awarded by trainers)','ការចូលរួមនិងពេលវេលាកំណត់ ១៥ ភាគរយ (ប្រគល់ជូនដោយគ្រូបណ្តុះបណ្តាល)','exp_li_6',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(55,'25% teaching demonstration during the workshop (awarded by workshop trainers using 14 indicators)','ការបង្រៀន បង្ហាញ ២៥% ក្នុងសិក្ខាសាលា (ផ្តល់ជូនដោយគ្រូសិក្ខាសាលាដោយប្រើសូចនាករ ១៤)','exp_li_7',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(56,'10% Production of teaching materials during the workshop (awarded by workshop trainers)','១០% ការផលិតសម្ភារៈបង្រៀនក្នុងសិក្ខាសាលា (ប្រគល់ជូនដោយគ្រូសិក្ខាសាលា)','exp_li_8',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(57,'20% one-page reflection on workshop content (assessed by workshop trainers)','ការឆ្លុះបញ្ចាំងមួយទំព័រ ២០ ភាគរយលើមាតិកាសិក្ខាសាលា (វាយតម្លៃដោយអ្នកបណ្តុះបណ្តាលសិក្ខាសាលា)','exp_li_9',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(58,'30% post-training application of workshop content – implementation report (assessed by school-based mentors)','ការអនុវត្ត ៣០% នៃការបណ្តុះបណ្តាលខ្លឹមសារសិក្ខាសាលា - របាយការណ៍អនុវត្ត (វាយតម្លៃដោយអ្នកណែនាំនៅសាលា)','exp_li_10',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(59,'Number of self-study hours of CPD activities successfully undertaken','ចំនួនម៉ោងសិក្សាដោយខ្លួនឯងនៃសកម្មភាព អវប បានអនុវត្តដោយជោគជ័យ','exp_li_11',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(60,'Quality and content of CPD programme and activities, including competencies promoted (benchmarking and standards)','គុណភាពនិងខ្លឹមសារនៃកម្មវិធីនិងសកម្មភាព អវប រួមទាំងសមត្ថភាពដែលត្រូវបានលើកកម្ពស់ (ការធ្វើជាគំរូនិងស្តង់ដារ)','exp_li_12',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(61,'Evaluation and assessment (demonstration of output and demonstration of outcome)','ការវាយត្រួតពិនិត្យនិងការវាយតំលៃ (ដោយមានការបង្ហាញលទ្ធផល)','exp_li_13',3,'','','1',3,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(62,'','','blog_banner',4,'1635304006_img_1854.jpg','','1',6,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(63,'CPD accreditation for training','ទទួលស្គាល់់ការបណ្តុះបណ្តាល អវប','blog_title_1',4,'','','1',6,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
(64,'Applicants for accreditation as a CPD provider or for accreditation of a CPD offering obtain the relevant form from the CPDMO or download it from the CPDMO website, fill it in and send it, along with the supporting evidence to the CPDMO (the form gives details of evidence required). Prior to filling in the form, applicants should consult within their organization to ensure the criteria for accreditation are understood and the best available evidence of meeting these can be produced. It is the responsibility of the applicant to explain on the form how the supporting evidence meets the criteria for accreditation (they may continue the explanation on a separate page if necessary).  Where they refer to evidence in the form of a long document, they should indicate precisely which part of this is relevant, using page numbers where necessary. \r\n               After reviewing the application and the evidence submitted, the CPDMO staff will engage with the applicant and request additional evidence if required. Once the application is complete, or all available evidence has been provided, the application will be assessed by the CPDMO staff, using the relevant instrument and submitted to the CPD accreditation committee, which will decide the outcome of the application, based on the staff’s assessment. The response will be communicated to the applicant within 60 days of a complete application (an application which includes all the necessary supporting evidence) being received.','ការដាក់ពាក្យសុំការទទួលស្គាល់គុណភាពជាអ្នកផ្ដល់សេវាឬបើកវគ្គ អវប អាចទាញយកទម្រង់ពាក្យស្នើសុំពីគេហទំព័ររបស់ការិយាល័យគ្រប់គ្រង អវប (ឧបសម្ព័ន្ធ៨) រួចបំពេញព័ត៌មាន និងបញ្ជូនទៅ ការិយាល័យគ្រប់គ្រង អវប  ដោយមានភស្ដុតាងគាំទ្រគ្រប់គ្រាន់។ អ្នកដាក់ពាក្យស្នើសុំត្រូវបំពេញឱ្យបានតាមលក្ខណៈវិនិច្ឆ័យទទួលស្គាល់គុណភាព និងមានភស្ដុតាងជាក់លាក់ ។ ក្នុងករណីមានភ័ស្ដុតាងជាទម្រង់ឯកសារច្រើនទំព័រ គួរតែបញ្ជាក់ពីផ្នែកដែលពាក់ព័ន្ធ និងលេខរៀងទំព័រ។ បន្ទាប់ពីការពិនិត្យពាក្យស្នើសុំនិងភ័ស្ដុតាងដោយប្រើឧបករណ៍ពាក់ព័ន្ធ បុគ្គលិកការិយាល័យគ្រប់គ្រង អវប នឹងអញ្ជើញអ្នកដាក់ពាក្យស្នើសុំឬក៏សុំផ្ដល់ភ័ស្ដុតាងបន្ថែមក្នុងករណីចាំបាច់ តែបើពិនិត្យឃើញថាបានបំពេញតាមលក្ខខណ្ឌ ការិយាល័យគ្រប់គ្រង  អវប  នឹងបញ្ជូនទៅ គណៈកម្មការសម្រាប់ ពិនិត្យ វាយតម្លៃ និង ផ្តល់ការទទួលស្គាល់គុណភាពគ្រឹះស្ថាន និងអ្នកផ្តល់សេវាការអភិវឌ្ឍវិជ្ជាជីវៈជាប្រចាំ ដើម្បីសម្រេចចុងក្រោយ។ រយៈពេលនៃការផ្ដល់លទ្ធផលស្នើសុំការទទួលស្គាល់គុណភាពយ៉ាងយូរ ៦០ ថ្ងៃគិតចាប់ពីពេលស្នើសុំដោយមានភ័ស្ដុតាងគ្រប់គ្រាន់។ រូបទី៤ខាងក្រោមបង្ហាញពីដំណាក់នៅក្នុងនីតិវិធីទទួលស្គាល់គុណភាព។','blog_content_1',4,'','','1',6,'0',1,1,1,'2021-11-23 00:55:24','2021-11-23 00:55:24'),
