(1,'2022-01-25',NULL,'វគ្គបណ្តុះបណ្តាលដល់សាលាគោលដៅចំនួន០៥ នៅខេត្តសៀមរាប',NULL,'នាយកដ្ឋានបុគ្គលិក','<?xml encoding=\"utf-8\" ?>\n','<?xml encoding=\"utf-8\" ?><!--?xml encoding=\"utf-8\" ?--><!--?xml encoding=\"utf-8\" ?--><!--?xml encoding=\"utf-8\" ?--><p>&lt;iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2FCPDMO.MoEYS%2Fposts%2F233964062232419&amp;show_text=true&amp;width=\"700\" width=\"500\" height=\"981\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\"&gt;&lt;/iframe&gt;<br></p>\n','1643148346_photo_2021_10_16_09_25_31.jpg',3110,1,'Post',1,NULL,NULL,1,1,'2022-01-26 11:55:57','2024-06-30 12:16:55'),
(2,'2022-01-26',NULL,'វគ្គបណ្តុះបណ្តាលស្តីពី\"ប្រព័ន្ធការអភិវឌ្ឃវិជ្ជាជីវៈជាប្រចាំ (អវប) និងប្រព័ន្ធមានគ្រប់គ្រងធនធានមនុស្ស (HRMIS)\" ដល់ខេត្តគោលដៅ \"ខេត្តព្រះវិហារ និងខេត្តឧត្តរមានជ័យ\"',NULL,'នាយកដ្ឋានបុគ្គលិក','<?xml encoding=\"utf-8\" ?>\n','<?xml encoding=\"utf-8\" ?><!--?xml encoding=\"utf-8\" ?--><!--?xml encoding=\"utf-8\" ?--><p><span style=\"font-size: 16px;\">&lt;iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2FCPDMO.MoEYS%2Fposts%2F234839822144843&amp;show_text=true&amp;width=700\" width=\"700\" height=\"962\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\"&gt;&lt;/iframe&gt;</span><br></p>\n','1643233015_o_2022_01_18_10_40_42.jpg',3726,1,'Post',2,NULL,NULL,1,1,'2022-01-27 11:36:55','2024-07-02 02:11:44'),
