(11,'2022-04-30','វិទ្យាស្ថានគរុកោសល្យរាជធានីភ្នំពេញ បានបើកវគ្គសិក្ខាសាលា (ផ្តល់សកម្មភាព អវប) ដល់សាលាបឋមសិក្សាចំនួន៥ នៅស្រុកពួក ខេត្តសៀមរាប នៅសាលាប','វិទ្យាស្ថានគរុកោសល្យរាជធានីភ្នំពេញ បានបើកវគ្គសិក្ខាសាលា (ផ្តល់សកម្មភាព អវប) ដល់សាលាបឋមសិក្សាចំនួន៥ នៅស្រុកពួក ខេត្តសៀមរាប នៅសាលាប','Department Of Personnel','នាយកដ្ឋានបុគ្គលិក','<?xml encoding=\"utf-8\" ?><p>&lt;iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2FCPDMO.MoEYS%2Fposts%2F294865292808962&amp;show_text=true&amp;width=500\" width=\"500\" height=\"800\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\"&gt;&lt;/iframe&gt; <!--?xml encoding=\"utf-8\" ?--></p>\n','<?xml encoding=\"utf-8\" ?><?xml encoding=\"utf-8\" ?><?xml encoding=\"utf-8\" ?><?xml encoding=\"utf-8\" ?><?xml encoding=\"utf-8\" ?><?xml encoding=\"utf-8\" ?><p>&lt;iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2FCPDMO.MoEYS%2Fposts%2F294865292808962&amp;show_text=true&amp;width=500\" width=\"500\" height=\"800\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\"&gt;&lt;/iframe&gt;<br></p>\n','1652371274_photo_2022_04_30_10_02_50.jpg',3352,1,'Post',11,'វិទ្យាស្ថានគរុកោសល្យរាជធានីភ្នំពេញ បានបើកវគ្គសិក្ខាសាលា (ផ្តល់សកម្មភាព អវប) ដល់សាលាបឋមសិក្សាចំនួន៥ នៅស្រុកពួក ខេត្តសៀមរាប នៅសាលាបឋមសិក្សាសសរស្តម្ភ រួមមាន សាលាបឋមសិក្សាទាបាញ់គំរូ សាលាបឋមសិក្សាចំបក់ហែ សាលាបឋមសិក្សាអធិបតិ សាលាបឋមសិក្សាសសរស្តម្ភ និងសាលាបឋមសិក្សាព្រៃជ្រួក ដែលមាន៥ ប្រធានបទ៖\r\n១.គរុកោសល្យ និងវិធីសាស្ត្រក្នុងការអប់រំវិទ្យាសាស្ត្រកម្រិតបឋមសិក្សា\r\n២.វេយក្យាករណ៍ខ្មែរ\r\n៣.ការប្រើប្រាស់បច្ចេកវិទ្យាព័ត៌មានវិទ្យា និងសារគមនាគមន៍(ICT) សម្រាប់ការបង្រៀន និងរៀន\r\n៤.ការបង្រៀន និងការគ្រប់គ្រងសិស្ស\r\n៥.ការអប់រំទូទៅ\r\nការបណ្តុះបណ្តាលនេះ ជាការសិក្សាបែបចំរុះ \"សិក្សាជួបមុខផ្ទាល់មានរយៈពេល ២ថ្ងៃ (៣០-០៤-២០២២ ដល់០១-០៥-២០២២) និងសិក្សាតាមOnline មានរយៈពេល២ថ្ងៃ(០៥-០៥-២០២២ ដល់០៦-០៥-២០២២)\" ដែលគាំទ្រដោយគម្រោង STEPCam អង្គការយូណេស្កូ','វិទ្យាស្ថានគរុកោសល្យរាជធានីភ្នំពេញ បានបើកវគ្គសិក្ខាសាលា (ផ្តល់សកម្មភាព អវប) ដល់សាលាបឋមសិក្សាចំនួន៥ នៅស្រុកពួក ខេត្តសៀមរាប នៅសាលាបឋមសិក្សាសសរស្តម្ភ រួមមាន សាលាបឋមសិក្សាទាបាញ់គំរូ សាលាបឋមសិក្សាចំបក់ហែ សាលាបឋមសិក្សាអធិបតិ សាលាបឋមសិក្សាសសរស្តម្ភ និងសាលាបឋមសិក្សាព្រៃជ្រួក ដែលមាន៥ ប្រធានបទ៖\r\n១.គរុកោសល្យ និងវិធីសាស្ត្រក្នុងការអប់រំវិទ្យាសាស្ត្រកម្រិតបឋមសិក្សា\r\n២.វេយក្យាករណ៍ខ្មែរ\r\n៣.ការប្រើប្រាស់បច្ចេកវិទ្យាព័ត៌មានវិទ្យា និងសារគមនាគមន៍(ICT) សម្រាប់ការបង្រៀន និងរៀន\r\n៤.ការបង្រៀន និងការគ្រប់គ្រងសិស្ស\r\n៥.ការអប់រំទូទៅ\r\nការបណ្តុះបណ្តាលនេះ ជាការសិក្សាបែបចំរុះ \"សិក្សាជួបមុខផ្ទាល់មានរយៈពេល ២ថ្ងៃ (៣០-០៤-២០២២ ដល់០១-០៥-២០២២) និងសិក្សាតាមOnline មានរយៈពេល២ថ្ងៃ(០៥-០៥-២០២២ ដល់០៦-០៥-២០២២)\" ដែលគាំទ្រដោយគម្រោង STEPCam អង្គការយូណេស្កូ',1,1,'2022-05-01 03:02:14','2024-07-01 08:20:24'),
(12,'2022-06-30','វគ្គបណ្តុះបណ្តាលស្តីពី \"ការប្រើប្រាស់ប្រព័ន្ធព័ត៌មានគ្រប់គ្រងធនធានមនុស្ស HRMIS និងកម្មវិធីទូរស័ព្ទដៃវៃឆ្លាត HRCPD\"ដល់ប្រធាន អនុប្រធាន មន្ត្រីជំនាញប្រព័ន្ធ HRMIS នៃការិយាល័យអប់រំ នៃរដ្ឋបាលក្រុង ស្រុក ចំនួន ១៦៨ក្រុង ស្រុក ដែលគាំទ្រដោយថវិកា CDPF','វគ្គបណ្តុះបណ្តាលស្តីពី \"ការប្រើប្រាស់ប្រព័ន្ធព័ត៌មានគ្រប់គ្រងធនធានមនុស្ស HRMIS និងកម្មវិធីទូរស័ព្ទដៃវៃឆ្លាត HRCPD\"ដល់ប្រធាន អនុប្រធាន មន្ត្រីជំនាញប្រព័ន្ធ HRMIS នៃការិយាល័យអប់រំ នៃរដ្ឋបាលក្រុង ស្រុក ចំនួន ១៦៨ក្រុង ស្រុក ដែលគាំទ្រដោយថវិកា CDPF','Department Of Personnel','នាយកដ្ឋានបុគ្គលិក','<?xml encoding=\"utf-8\" ?><p>&lt;iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2FCPDMO.MoEYS%2Fposts%2Fpfbid0tFwpAv18m3M2aLKEJ3to8hfmvgUqwCQmXrzCQJJ1uZbp7TuyZyXtAe5DoDMLCwBl&amp;show_text=true&amp;width=500\" width=\"500\" height=\"781\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\"&gt;&lt;/iframe&gt; <!--?xml encoding=\"utf-8\" ?--></p>\n','<?xml encoding=\"utf-8\" ?><p>&lt;iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2FCPDMO.MoEYS%2Fposts%2Fpfbid0tFwpAv18m3M2aLKEJ3to8hfmvgUqwCQmXrzCQJJ1uZbp7TuyZyXtAe5DoDMLCwBl&amp;show_text=true&amp;width=500\" width=\"500\" height=\"781\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\"&gt;&lt;/iframe&gt;<br></p>\n','1656570057_photo_2022_06_30_08_01_11_(3).jpg',1994,1,'Post',12,'ចាប់ពីថ្ងៃទី០៨ មិថុនា ដល់ថ្ងៃទី២៩ មិថុនា ២០២២ នាយកដ្ឋានបុគ្គលិកបានចុះបើកវគ្គបណ្តុះបណ្តាលស្តីពី \"ការប្រើប្រាស់ប្រព័ន្ធព័ត៌មានគ្រប់គ្រងធនធានមនុស្ស HRMIS និងកម្មវិធីទូរស័ព្ទដៃវៃឆ្លាត HRCPD\"ដល់ប្រធាន អនុប្រធាន មន្ត្រីជំនាញប្រព័ន្ធ HRMIS នៃការិយាល័យអប់រំ នៃរដ្ឋបាលក្រុង ស្រុក ចំនួន ១៦៨ក្រុង ស្រុក ដែលគាំទ្រដោយថវិកា CDPF','ចាប់ពីថ្ងៃទី០៨ មិថុនា ដល់ថ្ងៃទី២៩ មិ