(21,'2024-01-25',NULL,'ពិធីប្រគល់វិញ្ញាបនបត្រ​បញ្ចប់វគ្គសិក្សា កម្មវិធីអភិវឌ្ឍភាពជាអ្នកដឹកនាំ​ដល់មន្ត្រីក្រសួងអប់រំ យុវជន និងកីឡា',NULL,'នាយដ្ឋានបុគ្គលិក','<?xml encoding=\"utf-8\" ?>\n','<?xml encoding=\"utf-8\" ?><?xml encoding=\"utf-8\" ?><?xml encoding=\"utf-8\" ?><?xml encoding=\"utf-8\" ?><p>&lt;iframe src=\"https://www.facebook.com/plugins/post.php?href=https%3A%2F%2Fwww.facebook.com%2FCPDMO.MoEYS%2Fposts%2Fpfbid02VBjQVYHSacGURvLXh7HvYx7UkXKy7GZXYn7QQuyud2UZ77Z2idjjzt4rcrKSDaLzl&amp;show_text=true&amp;width=500\" width=\"500\" height=\"800\" style=\"border:none;overflow:hidden\" scrolling=\"no\" frameborder=\"0\" allowfullscreen=\"true\" allow=\"autoplay; clipboard-write; encrypted-media; picture-in-picture; web-share\"&gt;&lt;/iframe&gt;<br></p>\n','1706171162_photo_2024_01_25_15_18_58.jpg',601,1,'Post',21,'ពិធីប្រគល់វិញ្ញាបនបត្រ​បញ្ចប់វគ្គសិក្សា កម្មវិធីអភិវឌ្ឍភាពជាអ្នកដឹកនាំ​ដល់មន្ត្រីក្រសួងអប់រំ យុវជន និងកីឡា ដើម្បីលើកកម្ពស់ភាពជាអ្នកដឹកនាំ និងសមភាពយេនឌ័រ ដែលប្រព្រឹត្តិ​ទៅ​នៅថ្ងៃពុធ ១៤កើត ខែបុស្ស ឆ្នាំថោះ បញ្ចស័ក ព.ស. ២៥៦៧ ត្រូវនឹងថ្ងៃទី ២៤ ខែមករា ឆ្នាំ២០២៤ ក្រោមអធិបតីភាពដ៏ខ្ពង់ខ្ពស់ ឯកឧត្តមបណ្ឌិត​សភាចារ្យ ណាត ប៊ុនរឿន រដ្ឋមន្ត្រីស្តីទី ក្រសួងអប់រំ យុវជន និងកីឡា \r\nបុគ្គលិកអប់រំដែលបានបញ្ចប់ដោយជោគជ័យទទួលបាន ១ក្រេឌីត អវប(CPD credit) ។',NULL,1,1,'2024-01-25 15:23:43','2024-06-30 00:10:10'),
